import React from "react";
import "./index.scss";
import Logo from "../../assets/images/logo.png";
const RegisterPage = () => {
  return (
    <>
      <div className="wrapper">
        <div className="instagram-container">
          <div className="instagram-features">
            <div className="group">
              <div className="instagram-register-logo">
                <img src={Logo} alt="Logo" />
              </div>

              <p className="instagram-register-heading">
                Sign up to see photos and videos from your friends.
              </p>

              <h4 className="line">
                <span className="line-text">OU</span>
              </h4>

              <div className="instagram-register-div">
                <form className="instagram-form"></form>
              </div>
            </div>
          </div>
        </div>
      </div>
    </>
  );
};

export default RegisterPage;
